import React from 'react';
import styled from 'styled-components';
import { NavLink as Link } from 'react-router-dom';
import { FaBars } from 'reacts-icons/fa';

const Navbar = () => {
  return (
    <>
      <Nav>
          <NavLink to="/">
            <h1>Logo</h1>
          </NavLink>
          <Bars />
          <NavMenu>
            <NavLink to="/signup">
              <p>Sign Up</p>
            </NavLink>
            <NavLink to="/dasboard">
              <p>Dashboard</p>
            </NavLink>
            <NavLink to="/preferences">
              <p>Preferences</p>
            </NavLink>
          </NavMenu>
      </Nav>
    </>
  )
}

export default Navbar;
